    function clickHandler() {
        setValue("X")
    }

    function setSquareIndex() {
        console.log(index);        
    }
    
    return <button className="square" onLoadStart={setSquareIndex} onClick={clickHandler}></button>
}


export default function Board() {
    return (
        <>
            <div className="board-row">
